ElementsType.create(name: 'Voda', description: 'Voda je chemická zlúčenina vodíka a kyslíka.
Je základnou podmienkou pre existenciu života na Zemi.
Za normálnej teploty a tlaku je to bezfarebná, číra kvapalina bez zápachu a chuti. Na každých 15 kilogramov vašej
hmotnosti treba vypiť 0,5 litra vody.', GDA_man: 2000,
                     GDA_woman:1500,GDA_child:1250, unit: 'ml')

ElementsType.create(name: 'Súčiniteľ jedlého podielu', description: 'Udáva pomer hmotnosti jedlého podielu ku
celkovej hmotnosti jedla.', unit: 'pomer')

ElementsType.create(name: 'Sušina', description: 'Tuhý podiel zostávajúci v určitej látke po odstránení,
vyparení vody.', unit: 'g')

ElementsType.create(name: 'Bielkoviny', description: 'Sú nevyhnutnými zložkami všetkých rastlinných a živočíšnych
buniek
 a majú v nich tak z hľadiska množstva (50%), ako aj funkcie veľmi významné postavenie. Ako enzýmy sú nenahraditeľné
pri regulácii biochemických reakcií, ako hormóny pri sprostredkúvaní reakcií, ako stavebné látky v stavbe bunky,
 ako protilátky pri obrane organizmu a sú to aj dôležité transportné a rezervné látky. Dôležité sú aj pri zrážaní krvi a
 mlieka, pri druhu krvnej skupiny a pri pamäti. Schopnosť tvoriť aminokyseliny majú len rastliny,
živočíchy ich prijímajú potravou vo forme bielkovín. U živočíchov sa v tráviacom trakte rozkladajú na aminokyseliny,
 z ktorých si potom živočíšny organizmus znova tvorí vlastné špecifické bielkoviny.',
                     GDA_man: 55, GDA_woman:45,GDA_child:24, unit: 'g')

ElementsType.create(name: 'Tuky', description: 'Sú najdôležitejšou energetickou rezervou organizmu a podieľajú sa až
 50% na získavaní energie v biologických oxidáciách. Denne sa metabolizuje 100g lipidov, z ktorých sa uvoľňuje 3760 kJ
 (900 kcal).Lipidy ľudského organizmu sa rozdeľujú na triacylglyceroly (neutrálne tuky), fosfolipidy a cholesterol.
Triacylglyceroly slúžia predovšetkým ako energetická zásoba, fosfolipidy a cholesterol sa zúčastňujú na výstavbe
bunkových membrán, hormónov a iných funkčných molekúl. Tuky a oleje obsahujú mnoho mastných kyselín,
ktoré pôsobia na telo niekoľkými spôsobmi. Podľa najjednoduchšieho kritéria sa tuky delia na nasýtené a nenasýtené.
Nenasýstené tuky sa ďalej delia na mono- a polynenasýtené. Trans-mastné kyseliny sa vyskytujú aj prírodne v hovädzom
a baraňom mäse a v mliečnych výrobkoch.',
GDA_man: 95, GDA_woman:70,GDA_child:70, unit: 'g')

ElementsType.create(name: 'Kyselina palmitová', description: 'Kyselina palmitová je
nasýtená monokarboxylová kyselina. Jej názov napovedá, že sa nachádza napríklad v palmovom oleji, ale aj v masle,
syroch, mlieku a v mäse.',
                      unit: 'g')

ElementsType.create(name: 'Kyselina linolová', description: 'Kyselina linolová (CLA) nazývaná aj ako omega-6 kyselina
je nenasýtená mastná kyselina, ktorá tlmí potrebu prijímať nadmerné množstvo energie, čím zmierňuje pocity hladu a
spomaľuje rast tukového tkaniva. Napomáha tiež procesu znižovania hladiny cholesterolu a triacylglycerolov v krvi a
bráni tak vzniku predčasnej ateroskleróze a vysokého krvného tlaku. Zúčastňuje sa na tisícoch rôznych biochemických
reakcií v tele: na liečbe zápalov, prenose nervových vzruchov a tiež aj produkcii steroidných hormónov. Je zastúpená
v potravinách pochádzajúcich z prežúvavých zvierat (kráv, baranov) a nájdeme ju preto predovšetkým v mlieku,
mliekarenských výrobkoch, hovädzom a baraňom mäse. Výskumy potvrdili jej zdravotné benefity pri liečbe rôznych
ochorení. CLA môže spomaliť vznik a rozvoj rakoviny, brzdiť rozvoj kardiovaskulárnych ochorení a cukrovky typu 2.',
                     GDA_man: 18, GDA_woman:14,GDA_child:12, unit: 'g')

ElementsType.create(name: 'Kyselina linolénová', description: 'Kyselina linolénová nazývaná aj omega-3
kyselina napomáha udržiavať normálnu hladinu triglyceridov a cholesterolu v organizme,
čím pôsobí ako prirodzený ochranca ciev pred ich kôrnatením
 (ateroskleróza). Zároveň sú mastné kyseliny látkami potrebnými pre duševné funkcie, ako aj prirodzený vývoj u detí.',
                     GDA_man: 2.7, GDA_woman:2.2,GDA_child:2, unit: 'g')

ElementsType.create(name: 'Mastné kyseliny nasýtené', description: 'Veľké množstvo nasýtených tukov sa nachádza v
masle, tvrdých syroch, palmovom a kokosovom oleji a vo výrobkoch z mastného mäsa. Vysoký príjem týchto saturovaných
tukov sa spája so zvýšeným rizikom srdcových ochorení.',
                     unit: 'g')

ElementsType.create(name: 'Mastné kyseliny mononenasýtené', description: 'Forma tukov,
o ktorých sa predpokladá, že chránia pred srdcovými ochoreniami a aterosklerózou. Hlavným zdrojom je repkový a olivový
olej, avokádo, orechy a jadrá.',
                     GDA_man: 34, GDA_woman:29,GDA_child:25, unit: 'g')

ElementsType.create(name: 'Mastné kyseliny polynenasýtené', description: 'Väčšina rastlinných a rybích olejov,
ako aj tuk olejnatých rýb, patrí medzi potraviny s vysokým obsahom nenasýtených mastných kyselín s viacerými
dvojitými väzbami. Patria sem dve skupiny esenciálnych mastných kyselín, ktoré sú nevyhnutné na udržanie zdravia.
Mala by ich obsahovať každá strava aspoň v malom množstve. Strava bohatá na polynasýtené tuky a chudobná na nasýtené
tuky znižuje hladinu krvného cholesterolu a tým aj riziko srdcových a cievnych chorôb. ',
                     GDA_man: 21, GDA_woman:16,GDA_child:14, unit: 'g')

ElementsType.create(name: 'Trans-mastné kyseliny', description: 'Formy tukov vyskytujúce sa v prirodzenej podobe v
mäse a mliečnych výrobkoch, v umelej forme napríklad v umelých tukoch, sušienkach, koláčoch,
kde sa jedlý olej priemyselne stužil, aby sa pri izbovej teplote neroztekal. Výskum dokázal súvislosť medzi vysokou
konzumáciou umelo vyrábaných tukov a srdcovými chorobami.',
                      unit: 'g')

